    public function getSourceContext()
    {
        return new Source("{% extends 'layout.html.twig' %}

{% block page_title %}Connexion{% endblock %}

{% block content %}

    <div class=\"jumbotron col-md-3 mx-auto mt-4\">
        <form method=\"post\" novalidate>
            {% if error %}
                <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
            {% endif %}

            <h1 class=\"h3 mb-3 font-weight-normal\">Merci de vous identifier</h1>
            <label for=\"inputEmail\" class=\"sr-only\">Email</label>
            <input type=\"email\" value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" class=\"form-control\" placeholder=\"Email\" required autofocus>
            <label for=\"inputPassword\" class=\"sr-only\">Mot de passe</label>
            <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" placeholder=\"Mot de passe\" required>

            <input type=\"hidden\" name=\"_csrf_token\"
                   value=\"{{ csrf_token('authenticate') }}\"
            >

            {#
                Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.
                See https://symfony.com/doc/current/security/remember_me.html

                <div class=\"checkbox mb-3\">
                    <label>
                        <input type=\"checkbox\" name=\"_remember_me\"> Remember me
                    </label>
                </div>
            #}

            <button class=\"btn btn-lg btn-primary\" type=\"submit\">
                Se connecter
            </button>
        </form>
    </div>

{% endblock %}
", "security/login.html.twig", "/home/sankofa-impact/www-bass/reunionIT/templates/security/login.html.twig");
